import React from 'react'
import '../../Styles/Components/footer.scss'
const Footer = () => {
    return (
        <footer className='footer-container'>
            <div>
                <p>Desenvolvido por <a href="https://github.com/Nazareth98" target='_blank' rel='noreferrer'>Patrick Nazareth</a></p>
            </div>
        </footer>
    )
}

export default Footer
